import React from 'react';
const Card = ({name , email, id }) => {
	// let x = Math.random() * 100;
	// const {name , email, id } = props;
	return (
		<div className = 'tc bg-white-50% dib br3 pa3 ma2 grow bw2 shadow-5'>
			<img src={`https://robohash.org/${id*4}?200x200`} alt='robots'/>
			<div>
				<h2>{name}</h2>
				<p>{email}</p>
			</div>
		</div>
	);
}
export default Card;
